informacaoComplementar:
A contratação é justificada pela necessidade de modernização da infraestrutura técnica do Teatro Municipal, garantindo condições adequadas para a realização de produções culturais de diferentes portes e linguagens.
Com a aquisição, espera-se:
•	Elevar a qualidade técnica das produções realizadas no Teatro Municipal, adequando-se aos padrões exigidos por artistas e produtores culturais;
•	Reduzir custos com manutenção corretiva, uma vez que os equipamentos atuais demandam constantes reparos devido ao desgaste e obsolescência;
•	Aumentar a eficiência energética, por meio da substituição por equipamentos modernos e sustentáveis;
•	Fortalecer a rede pública de cultura, garantindo maior autonomia e padronização técnica para as ações realizadas no espaço;
•	Atender às diretrizes da PNAB, que preveem a aquisição de bens culturais duráveis para o fortalecimento da infraestrutura cultural pública.
Portanto, trata-se de investimento alinhado às necessidades locais e às políticas públicas nacionais de fomento e apoio à cultura.

