Cumprir com a ordem judicial referente ao processo nº 1028917-53.2022.8.26.0224, com a celeridade que a situação exige. Salientamos que o descumprimento das ordens judiciais geram ônus contra a administração pública municipal decorrente das multas imputadas, dos bloqueios das contas da Prefeitura ou mesmo de sanções mais graves.
Considerando que o Município não dispõe de Oficina Ortopédica própria e que há uma demanda significativa de pacientes que necessitam de equipamentos ortopédicos;
Considerando a ausência de fornecedores credenciados no Processo Administrativo nº 3395/2023, referente ao Chamamento Público nº 06/2024 – DLC; Torna-se imprescindível a aquisição dos referidos equipamentos por meio de Contrato Emergencial.

